@sgagsg Not gonna lie, this year is unfortunate for most of our mankind...we need to realize that these “problems” won’t just stop here as more people will still make the “same” mistakes and make “problems” that are unwanted. After this covid-19 virus and #blacklivesmatter protest, we all need to wake up and realize that we need to stop hating on each other and stay united and connected to one another no matter the person’s skin color, religion, race, gender and sexuality. No one deserves to be treated poorly nor suffer from violence. We have lost a lot of lives recently due to cyber bullying and that needs to stop too. If we continue to distance ourselves from being polite and caring for one another, we won’t have an safe and peaceful environment to live in. Let’s all thank the people who are helping us spread the love around the globe to make sure we are safe and healthy and tell everyone that we will all go through all of this together! So let’s all work together and safe the earth!

Love, 
@lexxzanderwillson
